import color_logo from '../images/color-logo.png'
import white_logo from '../images/color-logo.png'

const Nav = () => {
    return (
        <div>
            <div className="logo-container">
                <img className="logo" src={color_logo} alt="color-logo" />
            </div>
        </div>
    )
}
export default Nav
